import Grid from '@material-ui/core/Grid'

import FarmerHarvestList from "../components/FarmerHarvestList"
//import HarvestPublishing from "../components/HarvestPublishing"


export default function FarmersHarvestPage(props) {
    const [isClicked, setIsClicked] = useState(true)

    return(
    <>

    <Grid  container className='farmer-container' container >
    <div style={{width: '100%', height: '3vh'}}>
    </div>
       <FarmerHarvestList isClicked/>
    </Grid>
    </>

    )
}
